const generateHTMLContent = (projectWithUnitsAndDistrict) => {
  const { district, units } = projectWithUnitsAndDistrict;
  const project = projectWithUnitsAndDistrict;

  function formatEuroWithSpaces(number) {
    return new Intl.NumberFormat('de-DE', {
      style: 'currency',
      currency: 'EUR',
      minimumFractionDigits: 2,
      maximumFractionDigits: 2
    })
    .format(number)
    .replace(/\./g, ' ');
  }
  
  function formatArea(value) {
    if (value == null || value == 0) return "-";
    return value.toFixed(2);
  }

  return `
  <!DOCTYPE html>
  <html>
    <head>
      <meta charset="UTF-8">
      <title>${project.name} – Árlista</title>
      <style>
        body { font-family: Averta, sans-serif; font-size: 13px; }
        table { width: 100%; border-collapse: collapse; }
        th, td { border: 1px solid #CCC; padding: 4px; text-align: center; }
        th { background-color: #FFF; }
        .active-status { color: #B7E4C7; font-weight: bold; }
        .inactive-status { color: #E57373; font-weight: bold; }
      </style>
    </head>
    <body>
      <table>
        <thead>
          <tr>
            <th>Lh.</th>
            <th>Lakás*</th>
            <th>Emelet</th>
            <th>Szobák</th>
            <th>Alapterület (m²)</th>
            <th>Loggia (m²)</th>
            <th>Erkély (m²)</th>
            <th>Terasz (m²)</th>
            <th>Tetőterasz (m²)</th>
            <th>Kerti terasz (m²)</th>
            <th>Kert (m²)</th>
            <th>Teljes külső (m²)</th>
            <th>Összterület (m²)</th>
            <th>Eladási ár (befektetés)</th>
            <th>Eladási ár (saját)</th> 
            <th>Státusz</th>
          </tr>
        </thead>
        <tbody>
        ${units.map(unit => `
          <tr>
            <td>${unit.houseNumber || ""}</td>
            <td><a target="_blank" href="${unit.floorPlanUrlPNG || "#"}">TOP ${unit.unitNumber || ""}</a></td>
            <td>${unit.floorNumber || ""}</td>
            <td>${unit.roomNumber || ""}</td>
            <td>${formatArea(unit.livingArea) || ""}</td>
            <td>${formatArea(unit.loggiaArea) || "-"}</td>
            <td>${formatArea(unit.balconyArea) || "-"}</td>
            <td>${formatArea(unit.terraceArea) || "-"}</td>
            <td>${formatArea(unit.roofTerraceArea) || "-"}</td>
            <td>${formatArea(unit.gardenTerraceArea) || "-"}</td>                                 
            <td>${formatArea(unit.gardenArea) || "-"}</td>                                 
            <td>${formatArea(unit.sumOfOutsideAreas) || "-"}</td>                                 
            <td>${formatArea(unit.sumOfAllAreas) || "-"}</td>                                                              
            <td>${formatEuroWithSpaces(unit.listingPriceForInvestors) || ""}</td>
            <td>${formatEuroWithSpaces(unit.listingPriceForPersonalUse) || ""}</td>
            <td class="${unit.status === "Elérhető" ? "active-status" : "inactive-status"}">${unit.status || ""}</td>
          </tr>
        `).join('')}
        </tbody>
      </table>
    </body>
  </html>
  `;
};

export default async function handler(req, res) {
  try {
    res.setHeader('Access-Control-Allow-Origin', 'https://becsingatlan.com');
    res.setHeader('Access-Control-Allow-Methods', 'GET, POST, OPTIONS');
    res.setHeader('Access-Control-Allow-Headers', 'Content-Type');

    const { projectId } = req.query;

    if (!projectId || !mongoose.Types.ObjectId.isValid(projectId)) {
      return res.status(400).json({ error: "Invalid project ID" });
    }

    await connectDB();

    const project = await Project.findById(projectId)
      .populate("units")
      .populate("district")

    if (!project) {
      return res.status(404).json({ error: "Project not found" });
    }

    const projectData = project.toObject({ virtuals: true });

    const projectWithUnitsAndDistrict = {
      ...projectData,
      units: projectData.units || [],
      district: projectData.district || {}
    };

/*     const browser = await puppeteer.launch({
      args: chromium.args,
      defaultViewport: chromium.defaultViewport,
      executablePath: await chromium.executablePath(),
      headless: true,
      ignoreHTTPSErrors: true
    }); */
     
        
    const browser = await puppeteer.launch({
      executablePath: 'C:/Program Files/Google/Chrome/Application/chrome.exe',
      headless: true,
      args: ['--no-sandbox', '--disable-setuid-sandbox'],
    });  
   

    const page = await browser.newPage();
    const content = generateHTMLContent(projectWithUnitsAndDistrict);

    await page.setContent(content, { waitUntil: "networkidle0" });

    const pdfBuffer = await page.pdf({
      format: 'A4',
      landscape: true,
      margin: { top: "100px", bottom: "100px", left: "34px", right: "34px" },
      scale: 0.75,
      displayHeaderFooter: true,
      headerTemplate: generateHeaderElement(projectWithUnitsAndDistrict),
      footerTemplate: generateFooterElement()
    });

    await browser.close();

    res.setHeader('Content-Type', 'application/pdf');
    res.setHeader('Content-Disposition', `inline; filename="${project.name}_arlista.pdf"`);
    res.send(pdfBuffer);
  } catch (error) {
    console.error('Error generating PDF:', error);
    res.status(500).send('Error generating PDF');
  }
}


    